import React from 'react';
import { StyleSheet, View, Image, SafeAreaView } from 'react-native';
import { createBottomTabNavigator } from '@react-navigation/bottom-tabs';
import ProfileScreen from './screens/Profile';
import DashboardScreen from './screens/Dashboard';
import TicketsScreen from './screens/Tickets';
import EventScreen from './screens/Events';
import FontAwesome from '@expo/vector-icons/FontAwesome';
import { StatusBar } from 'expo-status-bar';

const Tab = createBottomTabNavigator();

const HomeScreen = ({ navigation }) => {
  return (
    <SafeAreaView style={{ flex: 1,}}>

      <StatusBar style="auto" />

      <Tab.Navigator
        initialRouteName="Dashboard"
        screenOptions={{
          tabBarActiveTintColor: '#008080',
          tabBarInactiveTintColor: 'silver',
          tabBarAllowFontScaling: false,
          headerTitleAllowFontScaling: false,
          tabBarStyle: {
            backgroundColor: 'white',
          },
          tabBarLabelStyle: {
            fontWeight: 'bold',
            elevation: 0,
            fontSize: 12,
            marginBottom: 5,
          },
          tabBarIconStyle: {}

        }}
      >

        <Tab.Screen name="Dashboard" component={DashboardScreen} 
          options={({ navigation }) => ({ 
            headerShadowVisible: false ,
            headerRight: () => (
              <View style={styles.iconBar}>
                <FontAwesome style={styles.icos} size={20} name="bell-o" onPress={() => navigation.navigate('Notifications')} />
                <FontAwesome style={styles.icos} size={20} name="qrcode" onPress={() => navigation.navigate('Scans')} />
              </View>
            ),
            headerLeft: () => (
              <Image
                source={require('./assets/user1.jpg')}
                style={{ width: 40, height: 40, marginLeft: 20, borderRadius: 50, borderWidth: 2, borderColor: 'ghostwhite' }}
              />
            ),
            headerTitle: 'SkaiMount Event Hub',
            headerTitleAlign: 'center',
            headerTitleStyle: {
              fontWeight: 'bold',
              fontSize: 20,
              color: '#008080',
            },
            tabBarIcon: ({ color }) => <FontAwesome size={20} name="dashboard" color={color} />,
          })}
        />

        <Tab.Screen name="Events" component={EventScreen} 
          options={{
            headerShadowVisible: false ,
            headerTitleStyle: {
              fontWeight: 'bold',
              fontSize: 20,
              color: '#008080',
            },
            headerTitleAlign: 'center',
            headerTitle: '',
            headerStatusBarHeight: -8,
            tabBarIcon: ({ color }) => <FontAwesome size={20} name="briefcase" color={color} />,
          }}/>

        <Tab.Screen name="Tickets" component={TicketsScreen} 
          options={({ navigation }) => ({ 
            headerRight: () => (
              <View style={styles.iconBar}>
                <FontAwesome style={styles.icos} size={20} name="bell-o" onPress={() => navigation.navigate('Notifications')} />
                <FontAwesome style={styles.icos} size={20} name="qrcode" onPress={() => navigation.navigate('Scans')} />
              </View>
            ),
            headerShadowVisible: false ,
            headerTitleStyle: {
              fontWeight: 'bold',
              fontSize: 20,
              color: '#008080',
            },
            headerTitleAlign: 'center',
            headerStatusBarHeight: 30,
            tabBarIcon: ({ color }) => <FontAwesome size={20} name="ticket" color={color} />,
          })}
          />

        <Tab.Screen name="Profile" component={ProfileScreen}
          options={{
            headerRight: () => (
              <Image
                source={require('./assets/user1.jpg')}
                style={{ width: 40, height: 40, marginRight: 20, borderRadius: 50, borderWidth: 2, borderColor: 'ghostwhite' }}
              />
            ),
            headerBackAllowFontScaling: false,
            headerShadowVisible: false ,
            headerTitleStyle: {
              fontWeight: 'bold',
              fontSize: 20,
              color: '#008080',
            },
            tabBarIcon: ({ color }) => <FontAwesome size={20} name="user-o" color={color} />,
          }}
        />

      </Tab.Navigator>
    </SafeAreaView>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',
  },

  labelStyle: {
    marginBottom: 20,
    fontWeight: 'bold',
    fontSize: 24,
  },
  buttonContainer: {
    marginTop: 10,
    flexDirection: 'row',
    justifyContent: 'space-around',
    width: '80%',
  },
  iconBar: {
    flexDirection: 'row',
    alignItems: 'center',
  },
  icos: {
    marginRight: 20,
    color: 'silver'
  }
});

export default HomeScreen;
